(window.webpackJsonp=window.webpackJsonp||[]).push([[70],{634:function(e){e.exports={name:"flexible-space",displayName:"FlexibleSpace *弹性空隔*",group:"layout",text:"\n用于在两个布局元素之间插入一段自动填充剩余空间的空白间隔：\n\n_注：为突显演示效果，我们为以下 Demo 中的 FlexibleSpace 组件添加了一些背景色。_\n\n``` demo.c4636fde\nimport { Linear, FlexibleSpace } from 'nami'\n\nrender(\n    <Linear>\n        <Linear.Item>Item</Linear.Item>\n        <Linear.Item>Item</Linear.Item>\n        <FlexibleSpace />\n        <Linear.Item>Item</Linear.Item>\n    </Linear>\n)\n```\n``` demo.0895c094\nimport { Linear, FlexibleSpace } from 'nami'\n\nrender(\n    <Linear direction=\"vertical\">\n        <Linear.Item>Item</Linear.Item>\n        <Linear.Item>Item</Linear.Item>\n        <FlexibleSpace />\n        <Linear.Item>Item</Linear.Item>\n    </Linear>\n)\n```\n\n## 参数\n\n### Divider\n\n| 参数        | 说明                                                                                     | 类型                               | 默认值       |\n| ----------- | ---------------------------------------------------------------------------------------- | ---------------------------------- | ------------ |\n| `direction` | 分隔方向<br>_一般在布局组件中使用时无须设置该参数，布局组件会自动按其布局方向为其设置；_ | `'horizontal'` &#124; `'vertical'` | `horizontal` |\n",path:"./src/components/flexible-space/index.md",demos:{c4636fde:{name:"horizontal"},"0895c094":{name:"vertical"}}}}}]);